import PropTypes from 'prop-types';
import FormItem from '../../../../shared/Form/FormItem/FormItem';
import Input from '../../../../shared/Input/Input';

const EnterTelegramId = props => {
    return (
        <div>
            <h2 className='xl:mb-7 mb-2 -mt-2 text-2xl font-medium text-gray-800'>Enter Telegram ID</h2>
            <p className='text-gray-700 lg:text-xl mb-2 lg:mb-5'>Please enter your Telegram ID below</p>
            <FormItem helpMessage label={'Telegram ID'}>
                <Input type={'text'} />
            </FormItem>
        </div>
    );
};

EnterTelegramId.propTypes = {};

export default EnterTelegramId;
